import React from 'react';


const Members = () => {

    window.scrollTo({
        top: 0,
        behavior: 'smooth'
    });

    return (
        <div>
            <div className="row mt-5" style={{ height: "405px" }}>
                <div className="col-12" style={{ top: "100px" }}>
                    <h2> העמוד יעלה בקרוב</h2>
                    <h2> עמכם הסליחה</h2>
                </div>
            </div>
        </div>
    );

}

export default Members;
